import React from "react";
import styles from './MainSection.module.scss';




export function MainSection({userData})  {
  return(
    <div className={styles.mainSectionDiv}>
      {userData.map((user) => {
        if (user.role === 'driver'){
          return (
            <div>
              <span>Driver : </span>{user.name}
              <div>{user.role}</div>
            </div>
          )
        } else {
          return (
            <div>
              <div>
                <span>Student : </span>{user.name}
                <div>{user.role}</div>
              </div>
            </div>
          )
        }}
      )}
    </div>
  )
}
